import GetAll from "../components/all_recipes";
import React, { useState } from "react";

const All = (props) => {
    const [product_list, setProduct_list] = useState([]);

    return (
        <div>
            <GetAll
                product_list={product_list}
                setProduct_list={setProduct_list}
            />
        </div>
    );
};

export default All;
